import React from 'react';
import JournalEntry from '../components/JournalEntry';
import '../styles/JournalEntryPage.css'; // Make sure the CSS file is imported

const JournalEntryPage = () => {
  return (
    <div className="journal-entry-page">
      <h1 className="journal-entry-title">Journal Entry</h1>
      {!user && (
        <div className="card-container">
          <h4>Your data will look something like this:</h4>
          <p>Sign in to see personalized insights based on your entries.</p>
        </div>
      )}


      <JournalEntry />
    </div>
  );
};

export default JournalEntryPage;
